##
## Copy this file to /var/etc/newbox.cfg
## To run Newbox with debug type $# newbox -v
## To run Newbox in background type $# newbox -b
## To run Newbox background and debug mode $# newbox -v -b
## To run Newbox with another config file type $# newbox -C /etc/newbox.cfg
##

INCLUDE "/var/etc/badcw.cfg"
INCLUDE "/var/etc/newbox.channelinfo"

##########################################################
## WEB INTERFACE
##########################################################

HTTP PORT: 5500 # Port WebIf
HTTP USER: root
HTTP PASS: Newbox

##########################################################
##      CLUSTERED CACHE (Compatible with CSP cache)     ##
##########################################################

CACHE PORT: 20080
#CACHE PEER: 127.0.0.1 20080 # SERVER

ACCEPT NULL ONID: 0
CACHE AUTOADD: NO
CACHE FILTER: YES
CACHE TIMEOUT: 50
CACHE FORWARD: YES
CACHE ALIVETIME: 15
CACHE RESENDREQ: YES
TRACE: 0

######################################################################
##                    CACHE GLOBAL USERS                            ##
######################################################################

CACHE PEER: hostmypeersandfriends.no-ip.org 20080 1 # FRIENDS

##########################################################
##               Radegast Server Connection             ##
##########################################################

#R: <host> <port> <caid> <providerlist>
#R: 127.0.0.1 5421 0100 3311 3315

##########################################################
##    SERVERS CONNECTIONS (CCCAM-NEWCAMD-MGCAMD)        ##
##########################################################

## Change you clientid (in hex) by default it is Generic
#ID POSSIBLE: Mgcamd(6D67), newcs(6E73), Evocamd(6576), CCcam(4343).
NEWCAMD CLIENTID: 6E73

######################################################################
##                   NEWCAMD GLOBAL USERS                           ##
######################################################################

## Global Users, must be defined before the first profile
#USER: guser1 gpass1  # for all profiles
#USER: guser1 gpass1 { 20001, 20002, 20003, 20004, 20005, 20006, 20007, 20008, 20009, 20010, 20011, 20012, 20013, 20014, 20015, 20016, 20017, 20018, 20019, 20020, 20021 }  # selected profiles by port list

######################################################################
##                          NLINES                                  ##
##                 AQUI PONEMOS LAS LINEAS N                        ##
######################################################################

#N: localhost \ # Host
#   4444 \ # Port
#   user \ # Username
#   pass \ # Password
#   01 02 03 04 05 06 07 08 09 10 11 12 13 14 # DES key
#N: ejemplonewcamd.dyndns.org 4444 user pass 01 02 03 04 05 06 07 08 09 10 11 12 13 14 # Newcs/Sbox

######################################################################
##                       CCCAM SERVER                               ##
######################################################################

CCCAM PORT: 18000
CCCAM PROFILES: 20001, 20002, 20003, 20004, 20005, 20006, 20007, 20008, 20009, 20010, 20011, 20012, 20013, 20014, 20015, 20016, 20017, 20018, 20019, 20020, 20021
CCCAM NODEID: aab1fadd1d26fd32
CCCAM CLIENTID: 4343
CCCAM VERSION: 2.0.11 # Select cccam client version "2.0.9", "2.0.11", "2.1.1", "2.1.2", "2.1.3", "2.1.4", "2.2.0", "2.2.1", "2.3.0", "3.0.1" (default: 2.0.11)
CCCAM DCW CHECK: YES

######################################################################
##                         CLIENTES                                 ##
##                 AQUI PONEMOS LAS LINEAS F                        ##
######################################################################
F: userclient1 password 2
F: userclient2 password 2

######################################################################
##                         SERVIDOR                                 ##
##                 AQUI PONEMOS LAS LINEAS C                        ##
######################################################################
C: ejemplo1.no-ip.org 15021 userserver1 password 2 { 20001, 20002, 20003, 20004, 20005, 20006, 20007, 20008, 20009, 20010, 20011, 20012, 20013, 20014, 20015, 20016, 20017, 20018, 20019, 20020, 20021 }
