######################################################################
##                       MGCAMD SERVER                              ##
######################################################################

MGCAMD PORT: 5003 # MGCAMD server listen port(default=0:disabled)
MGCAMD KEY: 01 02 03 04 05 06 07 08 09 10 11 12 13 14
MGCAMD PROFILES: 20001, 20002, 20003, 20004, 20005, 20006, 20007, 20008, 20009, 20010, 20011, 20012, 20013, 20014, 20015, 20016, 20017, 20018, 20019, 20020, 20021

# Clients
#MGUSER: user1 pass1 # send cards of all profiles
#MGUSER: user2 pass2 300 # send cards of all profiles with min. ecmtime = 300ms
#MGUSER: user3 pass3 { 20001, 20002, 20003, 20004, 20005, 20006, 20007, 20008, 20009, 20010, 20011, 20012, 20013, 20014, 20015, 20016, 20017, 20018, 20019, 20020, 20021 } # send cards of 2 selected profiles
